import React from 'react';
import classes from './Feira.module.css';

const feira = ( props ) => {

    
    return (
        <div className={classes.Feira}>
            <label>{props.nome}</label>
            <p></p>
            <label>{props.feira.nome}</label>
        </div>
    );
};

export default feira;
